__NUXT_JSONP__("nuestros-trabajos/F82CClxagLvqRSxa7ehY", (function(a,b){return {data:[{headingText:"La Boda de Mar y Álex",mainText:"\u003Cp\u003EMar y Álex lo tenían muy claro, querían una invitación sencilla pero única, y qué hay más único que sus manos entrelazadas. El dibujo de sus manos, hecho en grafito, donde asomase tímido pero presente el anillo de pedida de la abuela de Mar e impreso en un papel con textura de tejido, forma esta invitación\u002Frecuerdo de su boda.&nbsp;\u003C\u002Fp\u003E\n\u003Cp\u003E&nbsp;&nbsp;&nbsp;\u003C\u002Fp\u003E\n\u003Cp\u003EEl sobre, hecho en un color azul precioso y cerrado con un lazo en un tono crema, forma el final junto a una hermosa rama de lavanda de esta invitación tan especial.\u003C\u002Fp\u003E\n",imgSrc:a,thumbnailArray:[a,"https:\u002F\u002Ffirebasestorage.googleapis.com\u002Fv0\u002Fb\u002Fartenupcia.appspot.com\u002Fo\u002Fflamelink%2Fmedia%2Fsized%2F900_9999_100%2FIMG_4942.jpg?alt=media&token=df5e48de-9c4a-4544-9a04-6fec23611170","https:\u002F\u002Ffirebasestorage.googleapis.com\u002Fv0\u002Fb\u002Fartenupcia.appspot.com\u002Fo\u002Fflamelink%2Fmedia%2Fsized%2F900_9999_100%2FIMG_4941.jpg?alt=media&token=1020fbc8-8585-496e-892e-08d7b55766c9",b,b],badgeItems:["#minimalista","#recuerdoFamiliar"]}],fetch:[],mutations:void 0}}("https:\u002F\u002Ffirebasestorage.googleapis.com\u002Fv0\u002Fb\u002Fartenupcia.appspot.com\u002Fo\u002Fflamelink%2Fmedia%2Fsized%2F900_9999_100%2FIMG_4939.jpg?alt=media&token=a6a780dc-6d42-4ce3-b191-f1207e1985d8","")));